import React from 'react';


import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';

const EventForm = () => {
    return (
        <form>
            <label htmlFor='title'/>
            <input type='text'/>

            <label htmlFor='From:'/>
            <input type='text'/>

            <label htmlFor='To:'/>
            <input type='text'/>
        </form>
    );
};

export default EventForm;
